import React from 'react';
import { Route, Switch } from 'react-router-dom';
import Header from './components/Header';
import Home from './pages/Home';
import StoryPage from './pages/StoryPage';

function App() {

  return (
    <div className="wrapper clear">
      <Header /> 
      <Switch>
        <Route exact path="/">
          <Home />
        </Route>
        <Route path="/story">
          <StoryPage />
        </Route>
      </Switch>
    </div>
  );
}

export default App;
